import './comp.css';

function Comp19() {
    let arr1 = [];
    for (let i = 0; i < 4; i++) {
        arr1.push(<span>{i}</span>);
    }

    let arr2 = [1, 2, 3, 4, 5];
    let res2 = arr2.map(function (item, index) {
        return <li>key - {index}, item - {item}</li>
    })

    return (
        <div className="comp comp19">
            <h3><span>19</span></h3>
            <div>{arr1}</div>
            <div>{arr2}</div>
            <div>{res2}</div>
        </div>
    )
}

export default Comp19;
